import math
def readInt():
	return int(raw_input())
def readInts():
	return map(int,raw_input().split())
def divisors(n):
	result = ""
	for i in xrange(2,11):
		bn = convert(n,i)
		limit = int(math.floor(math.sqrt(bn))+1)
		j=2
		while i<=limit:
		#for i in xrange(2,limit):
			if bn%j==0:
				result+=str(j)+" "
				break
			j+=1
	return result
def convert(n, base):
	result = 0 
	multiplier = 1 
	while n>=1:
		reminder = n%10
		n=n/10
		result += reminder*multiplier
		multiplier=multiplier*base
	return result

